local Ease = require "actions/Ease"
local Parallel = require "actions/Parallel"
local BlockPlayer = require "actions/BlockPlayer"
local Wait = require "actions/Wait"
local Animate = require "actions/Animate"
local Do = require "actions/Do"

return function(self, player)
    if GameState:isFlagSet("ep4_abominable1") then
        return
    end
    GameState:setFlag("ep4_abominable1")
    self.scene:run(BlockPlayer {
        Parallel {
            Ease(self.scene.camPos, "x", -600, 1),
            Ease(self.scene.camPos, "y", 1400, 1)
        },
        Wait(2),
        Do(function() self.scene.objectLookup.Abominable.sprite:setAnimation("dark_right") end),
        Wait(1),
        Animate(self.scene.objectLookup.Abominable.sprite, "dark_leap_right"),
        Parallel {
            Ease(self.scene.objectLookup.Abominable, "x", function() return self.scene.objectLookup.Abominable.x + 200 end, 3, "linear"),
            Ease(self.scene.objectLookup.Abominable, "y", function() return self.scene.objectLookup.Abominable.y - 200 end, 3, "linear")
        },
        Parallel {
            Ease(self.scene.objectLookup.Abominable, "x", function() return self.scene.objectLookup.Abominable.x + 100 end, 3, "linear"),
            Ease(self.scene.objectLookup.Abominable, "y", function() return self.scene.objectLookup.Abominable.y + 800 end, 3, "quad")
        },
        Do(function() self.scene.objectLookup.Abominable:permanentRemove() end),
        Parallel {
            Ease(self.scene.camPos, "x", 0, 1),
            Ease(self.scene.camPos, "y", 0, 1)
        },
    })
end
